import { createGlobalStyle } from "styled-components";

const GlobalStyle = createGlobalStyle`
    * {
        @import url('https://fonts.googleapis.com/css2?family=Nanum+Gothic:wght@400;700;800&family=Roboto+Mono:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;1,100;1,200;1,300;1,400;1,500;1,600;1,700&display=swap');
        font-family: 'Roboto Mono', monospace;
        font-weight: bold;
        box-sizing: border-box;
        margin: 0;
        padding: 0;
        overflow: hidden;
    }
`;

export default GlobalStyle;
